import styled from "styled-components"
import bg from "./img/bg.png"
import { MainLayout } from "./styles/Layouts";



function App() {
  return (
    <AppStyled bgm={bg} className="App">
      <MainLayout>

      </MainLayout>
    </AppStyled>
  );
}

const AppStyled = styled.div`
  height:100vh;
  background-image:url(${props => props.bg});
  position:relative;
`;

export default App;
